import { Link } from "react-router-dom";
import "./index.css";

const DictionaryItem = (props) => {
  const { id, eachItem } = props;
  const { title, description, lexicalCategory } = eachItem;
  return (
    <Link to={`/worddetails/${id}`}>
      <h1 className="li-item-heading">{title}</h1>
      <p className="li-item-para">
        ({lexicalCategory}) {description}
      </p>
      <hr />
    </Link>
  );
};

export default DictionaryItem;
